using namespace std;

class TireTree {
private:
	struct node {
		int color; //white 1, black 0
		int posi;
		string x,y;
		int num;
		node *brother;
		node *child;
		node(int c, string x, string y):color(c),x(x),y(y),posi(-1), brother(NULL),child(NULL),num(0){}
		node(int c, int p):color(c),posi(p), brother(NULL),child(NULL),num(0){}
	};
	int convertPosi(string );
	void remove(node *);
	// bool isEqual();
	node *root;
public:
	int state;
	TireTree() {
		root = new node(-1, -1);
		state = -1;
	}
	int size() {
		return root->num;
	}
	~TireTree() {
		remove(root);
	}
	void load();
	void insert(string &seq);
	int findBest(string &seq, float* bonus);
	// void normalize();
};

void TireTree::remove(node *n) {
	if (n == NULL)
		return;
	remove(n->child);
	remove(n->brother);
	delete n;
	return;
}

void TireTree::insert(string &seq) {
	state = 1;
	char color;
	string x, y;
	int len = seq.length(), idx = 0;
	int num = 0;
	node *tmpC = NULL, *tmp = root, *tmpB = NULL;
	stringstream mid_seq(seq);
	mid_seq >> num;
	root->num += num;
	while ((tmpC = tmp->child) && mid_seq >> color >> x >> y) {
		if (color == 'B' && tmpC->color == 0 || 
			color == 'W' && tmpC->color == 1) { //颜色正确
			if (tmpC->x == x && tmpC->y == y) {
				tmp = tmpC;
				tmp->num += num;
				continue;
			} else {
				tmpB = tmpC->brother;
				while (tmpB) {
					tmpC = tmpB;
					if (tmpB->x == x && tmpB->y == y) {
						tmpB->num += num;
						break;
					}
					tmpB = tmpB->brother;
				}
				if (tmpB) {tmp = tmpB; continue;}
				if (color == 'B')
					tmpC->brother = new node(0, x, y);
				else 
					tmpC->brother = new node(1, x, y);
				tmpC->brother->num = num;
				tmpC = tmpC->brother;
				while (mid_seq >> color >> x >> y) {
					if (color == 'B')
						tmpC->child = new node(0, x, y);
					else 
						tmpC->child = new node(1, x, y);
					tmpC->child->num = num;
					tmpC = tmpC->child;
				}

			}
		}
	}
	while (mid_seq >> color >> x >> y) {
		if (color == 'B')
			tmp->child = new node(0, x, y);
		else 
			tmp->child = new node(1, x, y);
		tmp = tmp->child;
		tmp->num = num;
	}
}

int TireTree::findBest(string &pattern, float* bonus) {
	stringstream mid_seq(pattern);
	char color;
	string x, y;
	node *tmp = root->child, *tmpp = root;
	for(int i = 0; i < unipolar::BoardSizeSquare(unipolar::BOARD_SIZE); ++i)
		bonus[i] = 0;

	mid_seq >> color;
	while(tmp && mid_seq >> x >> y) {
	    if ((color == 'B' && tmp->color == 0 || 
			color == 'W' && tmp->color == 1) &&
			tmp->x == x && tmp->y == y) {
	    	tmpp = tmp;
		    mid_seq >> color;
	    	tmp = tmp->child;
	    	continue;
	    } else {
	    	tmpp = tmp;
	    	tmp = tmp->brother;
	    	while (tmp) {
	    		if ((color == 'B' && tmp->color == 0 || 
					color == 'W' && tmp->color == 1) &&
					tmp->x == x && tmp->y == y) {
	    			tmpp = tmp;
	    			tmp = tmp->child;
	    			break;
	    		} else {
	    			tmpp = tmp;
	    			tmp = tmp->brother;
	    		}
	    	}
	    }
	    color = '\0';
	    mid_seq >> color;
	    if (color == '\0') break;
	}
    color = '\0';
    mid_seq >> color;
	int MAX = -1, total = 0;
	node *max_node = NULL;
	if (color == '\0' && tmp){
		while(tmp) {
		    if (tmp->num > MAX){
		    	MAX = tmp->num;
		    	max_node = tmp;
		    }
    		char x_char = tmp->x[0];
			int x = (x_char > 'I' ? x_char - 1 : x_char) - 'A';
			int y = y = atoi(tmp->y.c_str()) - 1;
			// cout << tmp->num << ' ' << total << endl;
			total += tmp->num;
			bonus[x*13+y] = tmp->num;
	    	tmp = tmp->brother;
		}
	}

	// cout << total << endl;
	for(int i = 0; i < unipolar::BoardSizeSquare(unipolar::BOARD_SIZE); ++i) {
		if(bonus[i] < 1e-6)
			bonus[i] = 0;
		else 
			bonus[i] /= total;
		// limit the number.
		if(bonus[i] < 1e-4)
			bonus[i] = 0;
	}	
	if(!max_node)
		return -1;
	else {
		char x_char = max_node->x[0];
		int x = (x_char > 'I' ? x_char - 1 : x_char) - 'A';
		int y = y = atoi(max_node->y.c_str()) - 1;
		cout << "best move: " << x_char << ' ' << y+1 << endl;
		return x*13+y;
	}
}

